import React, { useState, useEffect } from 'react';
import { API } from "aws-amplify"
import config from "../../../config/constants"

function EditarConsoles() {

    const [userConsole, setUserConsole] = useState('');

    useEffect(() => {
        API.get(config.APIS.PLAYERSTARS, '/console/')
            .then(response => {
                console.log("ESSE E O RESPONSE", response.data)
                setUserConsole(response.data);
            })
            .catch(error => {
                console.log("ERRO NO GET: ")
            })
            // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [])

  return (
    <section className="containerEditConsole">
        <div className="contentEditConsole">
            <h2 className="titleEditConsole">Editar plataformas</h2>
            <p>Quais plataformas você usa?</p>
            <form >
                {userConsole.length > 0 ?
                    userConsole.map((platform, index) => (
                        <fieldset key={index}>
                            <input id={platform.entity_id} type="text" name={platform.name} />
                            <label htmlFor={platform.name}>Tagname do {platform.name}</label>
                        </fieldset>
                    )) : <div></div>
                }
                <div>
                        <button type="button" onClick={() => setRedirect(true)}>Cancelar</button>
                        <button type="submit" >Salvar alterações</button>
                </div>
            </form>
        </div>
    </section>
  );
}

export default EditarConsoles;
